const Spots = ({ spot }) => {
  return (
    <>
      {spot.map((spot) => (
        <Marker key={spot.id} position={[spot.lat, spot.long]}>
          <Popup>
            <h1>Testing. </h1>
            <p>testing x2</p>
          </Popup>
        </Marker>
      ))}
    </>
  );
};

export default Spots;
